import React from "react";

const Community = () => {
  return (
    <div style={{ paddingTop: "120px" }}>
      <h2>커뮤니티 페이지</h2>
      <p>여기에 게시판 콘텐츠를 넣습니다.</p>
    </div>
  );
};

export default Community;
